(66, 47, 1, 'I want to do an MBA to gain business knowledge, improve my leadership skills, and open up better career opportunities.', '2025-01-27 08:34:02'),
(67, 47, 2, 'In the next 5 to 10 years, I want to be in a leadership position, making important decisions and helping a company grow. I want to keep learning, gain more experience, and make a positive impact in my field.', '2025-01-27 08:34:02'),
(68, 47, 3, 'A successful manager should have good leadership skills, clear communication, problem-solving abilities, and the ability to work well with a team.\r\nFor example, when I had a lot of exams, I made a plan to study a little bit each day. I asked my teachers questions if I was confused, and I stayed on track. This helped me do well in my exams. It showed me that planning and asking for help when needed can lead to success.\r\n\r\n\r\n', '2025-01-27 08:34:02'),
(69, 47, 4, 'Finance ', '2025-01-27 08:34:02'),
(70, 47, 5, 'Both', '2025-01-27 08:34:02'),
(71, 48, 1, 'Carrier growth networking and better income ', '2025-01-27 10:18:26'),
(72, 48, 2, 'In the next 5 years, I see myself in a managerial role where I can lead teams, contribute to key business strategies, and drive impactful projects within a reputed organization. I aim to enhance my leadership skills, make meaningful contributions, and build a strong foundation for future growth.\r\n\r\nIn 10 years, I aspire to be in a senior leadership position, such as a director or VP, where I can influence organizational strategy, mentor future leaders, and contribute to the overall vision and growth of the company. Alternatively, I would also consider venturing into entrepreneurship to create and scale my own business.\r\n\r\n', '2025-01-27 10:18:26'),
(73, 48, 3, 'To be a successful manager, a person needs strong leadership, effective communication, decision-making skills, adaptability, empathy, and the ability to motivate and guide a team toward shared goals.\r\n\r\nExample: I led a team on a tight-deadline project facing low morale. By clarifying roles, setting clear goals, and fostering collaboration, we completed the project on time while improving team cohesion and morale.\r\n\r\n', '2025-01-27 10:18:26'),
