(111, 80, 1, 'I want to pursue an MBA to upskill myself with the strategic thinking, leadership, and business acumen necessary to drive impactful change and innovation in the tech industry, ultimately contributing to building more user-centric and effective solutions.', '2025-02-22 10:43:40'),
(112, 80, 2, 'In next 5-10 years I want to be a highly skilled financial professional where I can leverage my expertise for an organisation growth. I envision myself as a CFO, or maybe someone at the management level.', '2025-02-22 10:43:40'),
(113, 80, 3, 'An individual must possess qualities such as leadership, communication skills, decision making and other skills as well to be a successful manager. While I\'m still building my career and haven\'t yet reached the level of success I aspire to, I believe in my previous role I was solely responsible for handling the ERP system for accounting purposes where I was directly reporting to the manager. Alongside I was training other team members.', '2025-02-22 10:43:40'),
(114, 80, 4, 'I\'m fascinated by how financial decisions impact businesses and the economy. I\'m exploring FinTech, quantitative finance, and corporate finance, and I\'m looking forward to specializing in the area that best fits my skills and career goals.', '2025-02-22 10:43:40'),
(115, 80, 5, 'Self funded.', '2025-02-22 10:43:40'),
(116, 81, 1, 'I want to pursue an MBA because I believe it will bridge the gap between my technical expertise in biotechnology and the business skills needed to drive innovations in the healthcare industry. An MBA will equip me with leadership, strategic thinking, and financial management skills essential for managing research projects and biotech firms effectively. I also want to develop a broader understanding of operations, marketing, and supply chain management in the pharmaceutical and clinical research sectors. This degree will help me transition from a purely scientific role to a managerial position where I can contribute to impactful healthcare solutions.', '2025-02-23 16:17:20'),
(117, 81, 2, 'In the next five years, I see myself in a managerial role within the biotechnology or pharmaceutical sector, working on clinical research, healthcare management, or regulatory affairs. I aim to apply my scientific knowledge along with business acumen to improve drug development processes and patient care strategies. In ten years, I aspire to take on leadership roles, possibly as a director or project head in a biotech firm, research organization, or healthcare startup. My ultimate goal is to contribute to innovations in healthcare while also mentoring young professionals entering the industry.', '2025-02-23 16:17:20'),
(118, 81, 3, 'A successful manager needs strong leadership, problem-solving skills, adaptability, and effective communication. They should be able to make decisions under pressure, motivate teams, and drive results while maintaining a positive work environment. Managers should also have a strategic vision and a deep understanding of their industry.\r\nOne situation where I demonstrated these skills was during my research project on checking plant growth and changes due to heavy metal pollution. I led my team through experimental challenges, coordinated with labs, and ensured we met deadlines. Through teamwork and problem-solving, we successfully completed the project with impactful findings.', '2025-02-23 16:17:20'),
(119, 81, 4, 'My preferred specialization is Healthcare and Hospital Management because it aligns with my background in biotechnology and my passion for improving healthcare systems. This specialization will help me understand the business side of pharmaceuticals, clinical research, and hospital administration. I am particularly interested in areas like healthcare operations, regulatory affairs, and strategic management in the biotech and pharmaceutical industries. By specializing in this field, I aim to contribute to the efficiency of healthcare services and bridge the gap between scientific research and practical healthcare applications.', '2025-02-23 16:17:20'),
(120, 81, 5, 'Students education loan for 2nd year and self funded for my 1st year ', '2025-02-23 16:17:20'),
